              position.coords.latitude,
              position.coords.longitude
            ];

            const rad = (x) => {
              return (x * Math.PI) / 180;
            };

            const getDistance = (p1, p2) => {
              const R = 6378137; // Earth’s mean radius in meter
              const dLat = rad(p2[0] - p1[0]);
              const dLong = rad(p2[1] - p1[1]);
              const a =
                Math.sin(dLat / 2) * Math.sin(dLat / 2) +
                Math.cos(rad(p1[0])) * Math.cos(rad(p2[0])) * Math.sin(dLong / 2) * Math.sin(dLong / 2);
              const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
              const d = R * c;
              return d; // returns the distance in meter
            };

            const nearPoints = centerList.map((rows) => {
              return { ...rows, nearPoint: getDistance(geoLocation, rows) };
            });

            const orderBynearPointList = nearPoints.sort((a, b) => {
              return +(a.nearPoint > b.nearPoint) || +(a.nearPoint === b.nearPoint) - 1;
            });

            wi=orderBynearPointList[0]['0'];
            gung=orderBynearPointList[0]['1'];
